func minimumSum(nums []int) int {
    leftMax := make([]int, len(nums))
    minSum := -1
    for i := range leftMax {
        leftMax[i] = -1
    }
    for j := 1; j < len(nums)-1; j++ {
        for i := 0; i < j; i++ {
            if nums[i] < nums[j] {
                if leftMax[j] == -1 || nums[i] < nums[leftMax[j]] {
                    leftMax[j] = i
                }
            }
        }
    }
    for k := len(nums) - 2; k > 0; k-- {
        for j := k + 1; j < len(nums); j++ {
            if nums[k] > nums[j] && leftMax[k] != -1 {
                sum := nums[leftMax[k]] + nums[k] + nums[j]
                if minSum == -1 || sum < minSum {
                    minSum = sum
                }
            }
        }
    }
    return minSum
}
